import './الملاعب.css' ;



function الملاعب()  {
   
  const [star , setStar ]= useState(true) ;
  const [san , setSan ]= useState(true) ;
  const [sentiage , setSentiage ]= useState(true) ;
  const [elshrouk , setElshrouk ]= useState(true) ;
      return(
        <div className="الملاعب">
         
         
          
         <button onClick={()=>setStar(!star)}>
           Star Park
         </button>

         <button onClick={()=>setStar(!setSan) }>
           San Sero
         </button>

         <button onClick={()=>setStar(!setSentiage)}>
           Sentiage
         </button>

         <button onClick={()=>setStar(!setElshrouk)}>
           Elshrouk
         </button>

          <div className="table">
          {
            star? <h1>Starpark</h1> :null
          }
           </div>
           <div className="table">
           {
            san? <h1>San Sero</h1> :null
          }
              </div>
           <div className="table">
             
              </div>
           <div className="table">
             
              </div>
          
           {
            sentiage? <h1>Sentiage</h1> :null
          }
           {
            elshrouk? <h1>Elshrouk</h1> :null
          }
          
          
        </div>
      
      )
    
  
}

export default الملاعب ;
